import React from 'react';
const Header: React.FC = () => {
  return (
    <header style={{ 
      backgroundColor: '#333', 
      color: '#fff', 
      padding: '1rem', 
      display: 'flex', 
      justifyContent: 'space-between', 
      alignItems: 'center' 
    }}>
      <div>
        <h1>My Website</h1>
        <nav>
          <ul style={{ display: 'flex', listStyle: 'none', gap: '1rem', margin: 0, padding: 0 }}>
            <li><a href="#home" style={{ color: '#fff' }}>ホーム</a></li>
            <li><a href="#about" style={{ color: '#fff' }}>概要</a></li>
            <li><a href="#contact" style={{ color: '#fff' }}>連絡</a></li>
          </ul>
        </nav>
      </div>
      <a href="https://x.com/hiy_ait_kk" target="_blank" rel="noopener noreferrer">
        <img 
            src="/images/xlogo.png" 
            alt="Twitter" 
            style={{ width: '24px', height: '24px' }} 
        />
      </a>
    </header>


  );
};

export default Header;
